While I agree with the friend that this is overkill, I do not believe that this is the case. The research that the narrator is referring to is the R0, or basic reproduction number. This number is a metric used to quantify how contagious an infection is. A value of 1.0 is considered non-transmissible, and a value greater than 1.0 indicates that the infection can be transmitted from one person to another. The R0 of the novel coronavirus (COVID-19) is currently estimated to be between 2.0 and 2.5. This means that, on average, two to four people are likely to be infected by a single infected person. However, this number can vary widely based on factors such as the population density of the area, the age distribution of the population, and the presence of pre-existing health conditions. The CDC, WHO, and other public health organizations around the world recommend that people take the following actions to prevent the spread of COVID-19:

- Washing your hands with soap and water for at least 20 seconds, especially after going to the bathroom;
- Avoiding close contact with people who are sick;
- Avoiding touching your face;
- Masks are not 100
